protected void subscribeActual(CompletableObserver observer) {
    CompletableDisposable md = new CompletableDisposable(observer, this);
    observer.onSubscribe(md);
    if (add(md)) {
        if (md.isDisposed()) {
            remove(md);
        }
    } else {
        Throwable ex = error;
        if (ex != null) {
            observer.onError(ex);
        } else {
            observer.onComplete();
        }
    }
}

